import React from 'react'
import { Link } from 'react-router-dom';
import styled from 'styled-components'

const HeaderStyled = styled.header`
    /* background-color: pink; */
    display: flex;
    flex-flow: row nowrap;
    justify-content: space-between;
    align-items: center;
    margin: 0 auto;
    width: 100%;
    max-width: 1620px;

    h1 {
        padding: 20px 0;
        font-size: 1.8rem;
        font-weight: 800;
    }
    h1 span:nth-child(1) {
        color: orange;
    }
    h1 span:nth-child(2) {
        color: #708090;
    }
    nav ul{
        display: flex;
        flex-flow: row nowrap;
        justify-content: space-between;
        align-items: center;
    }
    nav ul li {
        margin-left: 40px;
        list-style: none;
    }
`;

const LinkStyled = styled(Link)`
        color: #708090;
        font-size: 1.2rem;
        font-weight: 600;
`;

const ButtonLink = styled(LinkStyled)`
    background-color: #FFF;
    padding: 9px 25px;
    border-radius: 100px;
    box-shadow: 0 0 15px rgba(112,128,144,0.4);
`;

function Header() {
    return (
        <HeaderStyled>
            <h1>
                <span>YUMMY</span>
                <span>APP</span>
            </h1>

            <nav>
                <ul>
                    <li>
                        <LinkStyled to="#">Login</LinkStyled>
                    </li>
                    <li>
                        <LinkStyled to="#">Sign In</LinkStyled>
                    </li>
                    <li>
                        <ButtonLink to="#">Submit Recipes</ButtonLink>
                    </li>
                </ul>
            </nav>
        </HeaderStyled>
    )
}

export default Header
